INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div class="row">\r\n<div class="large-12 columns">\r\n<div class="row">              \r\n<a href=""><img src="sites/default/files/logo.png" alt="Logo"></a>\r\n</div>\r\n</div>', 'Logo de la Alegre Cocina de Dino''s', 'full_html'),
(2, '<div class="large-12 columns">\r\n                    \r\n                        <ul id="menuPrincipal" class="large-12 columns" class="side-nav">\r\n                            <div class="row">\r\n                                <li><a href="" title="Página Principal"><i class="fi-home"></i> Principal</a></li>\r\n                                <li><a href="recetas" title="Recetas del Chef Dino"><i class="fi-clipboard-notes"></i> Recetas</a></li>\r\n                                <li><a href="videos" title="Videos cortos de 10 minutos"><i class="fi-video"></i> Programas de Cocina</a></li>\r\n                                <li><a href="biografia" title="Acerca de Mí"><i class="fi-torso"></i> Acerca de Mí</a></li>\r\n                                <li><a href="" title="Reflexiones para una Vida Mejor"><i class="fi-page-edit"></i> Reflexiones para una Vida Mejor</a></li>\r\n                                <li><a href="" title="Curiosidades de la Cocina"><i class="fi-clipboard-notes"></i> Curiosidades de la Cocina</a></li>\r\n                                <li><a href="" title="Descarga Gratis las Canciones del Chef"><i class="fi-sound"></i> Mis Canciones</a></li>\r\n                                <li><a href="" title="El Poder Curativo de los Vegetales"><i class="fi-trees"></i> El Poder Curativo de los Vegetales</a></li>\r\n                                <li><a href="contact" title="Medios de Contacto"><i class="fi-marker"></i> Contacto</a></li>\r\n                            </div>\r\n                        </ul>\r\n                    \r\n                </div>\r\n\r\n</div> <!-- Cierre de los Bloques Logo y Menú Principal del Sitio -->\r\n', 'Menu Principal del Sitio', 'full_html'),
(3, '<div class="row">\r\n\r\n<div id="ubicacion" class="large-12 columns">\r\n<hr>\r\n<a class="th radius" href="#">\r\n<img src="sites/default/files/google_maps.gif" alt="">\r\n</a>\r\n<hr>\r\n\r\n</div>', 'Ubicacion Google Maps', 'full_html'),
(4, '<div class="row">\r\n \r\n<div id="visitas" class="large-12 columns">\r\n           <h4>2400 Visitas</h4>\r\n</div>\r\n\r\n</div>', 'Contador de Visitas', 'full_html'),
(5, '<div class="row">\r\n <div id="publicidad_izquierda" class="large-12 columns">\r\n            <hr>\r\n            <a class="fi-burst-sale" href="#"></a>\r\n        </div>\r\n</div>', 'Publicidad', 'full_html'),
(6, '<div class="row"><div id="slider" class="large-12 columns">\r\n            <div class="row">\r\n                <ul class="example-orbit" data-orbit>\r\n                    <li data-orbit-slide="slider2"> <img src="sites/default/files/slider/dino6.jpg" alt="slide 1" /><div class="orbit-caption tituloSlider2">Programas de Cocina</div></li>\r\n                    <li data-orbit-slide="slider1"><img src="sites/default/files/slider/dino1.jpg" alt="slide 0" /><div class="orbit-caption tituloSlider">Recetas del Chef Dino</div></li>\r\n                    \r\n                    <li data-orbit-slide="slider3"> <img src="sites/default/files/slider/dino3.jpg" alt="slide 2" /> <div class="orbit-caption tituloSlider">El Poder Curativo de los Vegetales</div></li>\r\n                    <li data-orbit-slide="slider4"> <img src="sites/default/files/slider/dino7.jpg" alt="slide " /> <div class="orbit-caption tituloSlider2">Canciones del Chef</div></li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n        \r\n        <div style="margin-top:-20px;" class="large-12 columns">\r\n            <div id="sliderBoton" class="row">\r\n                <a class="small button large-3 columns tituloSlider" data-orbit-link="slider1"> Recetas</a>\r\n                <a class="small button large-3 columns tituloSlider2" data-orbit-link="slider2">Videos</a>\r\n                <a class="small button large-3 columns tituloSlider" data-orbit-link="slider3"> Vegetales</a>\r\n                <a class="small button large-3 columns tituloSlider2" data-orbit-link="slider4"> Canciones </a>\r\n            </div>\r\n        </div>\r\n        \r\n        <hr>\r\n</div>', 'SlideShow', 'html5'),
(7, '<div class="row">\r\n\r\n<div class="large-12 columns">\r\n                    \r\n                        <ul id="menuPrincipal" class="large-4 columns" class="side-nav">\r\n                            <div class="row">\r\n                                <li><a href="recetas" title="Recetas del Chef Dino"><i class="fi-clipboard-notes"></i> Recetas</a></li>\r\n                                <li><a href="videos" title="Videos cortos de 10 minutos"><i class="fi-video"></i> Programas de Cocina</a></li>                                               \r\n                            </div>\r\n                        </ul>\r\n                        \r\n                        <ul id="menuPrincipal" class="large-4 columns" class="side-nav">\r\n                            <div class="row">\r\n                                <li><a href="biografia" title="Acerca de Mí"><i class="fi-torso"></i> Acerca de Mí</a></li>                                        \r\n                                <li><a href="#" title="Reflexiones para una Vida Mejor"><i class="fi-page-edit"></i> Reflexiones para una Vida Mejor</a></li>                                                          \r\n                            </div>\r\n                        </ul>\r\n                        \r\n                        <ul id="menuPrincipal" class="large-4 columns" class="side-nav">\r\n                            <div class="row"> \r\n                                <li><a href="#" title="Descarga Gratis las Canciones del Chef"><i class="fi-sound"></i> Mis Canciones</a></li>                               \r\n                                <li><a href="#" title="El Poder Curativo de los Vegetales"><i class="fi-trees"></i> El Poder Curativo de los Vegetales</a></li>\r\n                            </div>\r\n                        </ul>\r\n                    \r\n                </div>\r\n\r\n\r\n</div>', 'Menu Footer', 'full_html'),
(8, '<div class="row">\r\n\r\n<div id="socialPie" class="large-12 columns">          \r\n           \r\n                \r\n<div class="large-3 columns">\r\n<a class="large-12" href="https://www.facebook.com/laalegre.cocinadedino" target="_blank" title="laalegrecocinadedino"><i class="fi-social-facebook"></i> </a>\r\n</div>\r\n<div class="large-3 columns">\r\n<a class="large-12 " href="https://twitter.com/LaCocinaDeDino" target="_blank" title="@lacocinadedino"><i class="fi-social-twitter"></i> </a>\r\n</div>\r\n<div class="large-3 columns">\r\n <a class="large-12 " href="https://plus.google.com/u/0/108599586614211584379" target="_blank" title="laalegrecocinadedino"><i class="fi-social-google-plus"></i> </a>\r\n</div>\r\n<div class="large-3 columns">\r\n <a class="large-12 "  href="http://www.pinterest.com/alegrecocinaded/" target="_blank" title="alegrecocinaded"><i class="fi-social-pinterest"></i> </a> \r\n</div>\r\n                    \r\n\r\n        </div>\r\n\r\n</div>', 'Social Footer', 'full_html'),
(9, '<div class="row">\r\n\r\n<div id="social" class="large-12 columns">\r\n            <ul>\r\n                <li><a href="https://www.facebook.com/laalegre.cocinadedino" target="_blank"><i class="fi-social-facebook"></i> laalegrecocinadedino</a></li>\r\n                <li><a href="https://twitter.com/LaCocinaDeDino" target="_blank"><i class="fi-social-twitter"></i> @lacocinadedino</a></li>\r\n                <li><a href="https://plus.google.com/u/0/108599586614211584379" target="_blank"><i class="fi-social-google-plus"></i> laalegrecocinadedino</a></li>\r\n                <li><a href="http://www.pinterest.com/alegrecocinaded/" target="_blank"><i class="fi-social-pinterest"></i> alegrecocinaded</a></li>\r\n            </ul>\r\n            <hr>\r\n        </div>\r\n\r\n</div>', 'Social', 'full_html'),
(10, '<div id="pie" class="large-12 columns">\r\n            <div class="large-4 columns text-center">\r\n                <i class="fi-telephone large-12 columns"></i>\r\n                <p>0212-000-00-00</p>\r\n                <p>0424-000-00-00</p>\r\n            </div>\r\n            <div class="large-4 columns text-center">\r\n                <i class="fi-web large-12 columns text-center"></i>\r\n                <p><a hre="">&copy; WebMetropoli.com</a></p>\r\n                <p><i class="fi-html5"></i> Html5 <i class="fi-css3"></i> CSS3 <i class="fi-foundation"></i> Foundation5</p>\r\n            </div>\r\n            <div class="large-4 columns text-center ">\r\n                <i class="fi-mail large-12 columns"></i>\r\n                <p><i class="fi-mail"></i> laalegrecocinadedino@gmail.com</p>\r\n                <p><i class="fi-mail"></i> alegrecocinadedino@hotmail.com</p>           \r\n            </div>           \r\n</div>', 'Footer', 'full_html'),
