('node', 'videos', 0, 9, 9, 'und', 0, '<hr>\r\n<div class="flex-video widescreen vimeo"> <iframe src="//www.youtube.com/embed/Yh06R1AxONo" width="400" height="225" frameborder="0" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe> </div>', '<div id="recetasCat" class="row">\r\n<!-- ################################# -->\r\n<div class="large-12 columns">\r\n<div class="large-2 columns"><div class="row"><a class="th" href="videos/sopas-y-cremas"><img src="sites/default/files/img_video.jpg" alt="" style=""></a></div></div>\r\n<!-- ################################# -->\r\n<div class="large-10 columns"><div class="row">                \r\n<p class="tex-justify">Video Corto que muestra la preparación de una Ensalada Colombiana realizada por nuestro Chef Dino.</p>   \r\n<p>\r\n<a class="success label" href="ensalada-colombiana"><i class="fi-video"></i> Ver Video &raquo;</a>\r\n<a class="regular label" href="#"><i class="fi-video"></i> Ver Receta &raquo;</a>\r\n<a class="alert label" href="#"><i class="fi-clipboard-notes"></i> Ver Galería &raquo;</a>\r\n</p>\r\n</div></div>\r\n<!-- ################################# -->\r\n</div>', 'html5'),
('node', 'page', 0, 10, 10, 'und', 0, '<div class="row" id="historia">\r\n<hr>\r\n<h1 class="panel"><i class="fi-book-bookmark"></i> Mi Historia</h1>\r\n<p  class="text-justify">Llegué a Venezuela un día de mayo de 1955, entré por el puerto de la Guáira. El propósito:  <em>trabajar durante uno o dos años para guardar suficiente dinero para regresar a mi Italia   querida y terminar mis estudios de medicina</em> , no sucedió así ; las dificultades como el idioma, la alimentación , la adaptación el  ambiente , la soledad , el miedo al “ que será” , cambiaron todos mis planes . Fui lavaplatos, mesero, conocí a varios cocineros en varios restaurantes  y me di cuenta que yo cocinaría mejor que ellos, pero callaba para no ganarme enemigos.</p>\r\n<p class="text-justify">Pero un día sucedió que el chef del restaurante donde yo trabajaba como mesonero, se cayó y se fracturó un brazo. Los dueños del restaurante se desesperaron y yo me atreví a decirles; si quieren o me lo permiten yo puedo hacerme cargo, les explique que desde muy pequeño viví entre ollas y sartenes en la cocina de la hostería de mi tío allá en Italia. Aceptaron de mala gana ya que no tenían otra alternativa.</p>\r\n<p class="text-justify">Ese día comenzó mi carrera como chef en Venezuela…. Era mayo de 1957 (ya tenía dos años en Venezuela). Esa noche (15-05-1957) a los clientes que me reclamaban como mesonero en la sala , uno de los dueños que me sustituyo orgullosamente gritaba: Dino es nuestro chef a partir de hoy y muchos clientes entraron a la cocina a felicitarme a dejarme jugosas propinas. Las salsas, las carnes, los pescados los convertí en delicias… recuerdo que al final de ese día conté los primeros 880 bolívares. Repartí la mitad con el personal de la cocina y el cariño, los abrazos y los besos de personal femenino me abrumaron…. Y comencé a sentirme menos solo… la noticia se difundió en la zona.</p>\r\n<p class="text-justify"><em> En el hotel Rex de ciudad Ojeda hay un cocinerito que cocina demasiado sabroso</em> y dos semanas después la gente hacia cola para conseguir una mesa, cuando Tony; el chef, llego de nuevo con su brazo más o menos sano los dueños le dijeron ¡Nos Quedamos Con Dino ¡…. Lo lamenté mucho por el ¡Comenzaron las entrevistas en la radio , en la prensa escrita ,las ofertas de trabajo con mejor remuneración pero , yo le fue fiel al hotel Rex. Dicté varios cursos de cocina en un salón que me facilitaron los dueños el Hotel, pasaron varios años y luego me fui para Mérida, porque? Por mi espíritu aventurero , tal vez por el clima .. Tal vez por una merideña? Tal vez... Tal vez…. Pero me fui para Mérida. Conocí a Leonardo Páez  ecuatoriano, demasiado culto e inteligente y director de radio universidad y por primera vez tuve un micrófono delante de mí y conduje un programa : El <strong>“Ama De Casa En La Cocina”</strong> ( bajo la batuta del maestro Dino) era el año 1960 al mismo tiempo trabajaba en el hotel la sierra ( que ya no existe) conocí al Dr. Pedro Rincón Gutiérrez(Rector de la Universidad de los Andes) quien me animo a revalidar mis estudios de medicina ( no fue posible) Un día llego al  hotel la sierra una comisión de CONAHOTU ( corporación nacional de hoteles y turismo ) me conquistaron y me contrataron como chef del hotel Trujillo ( todavía existe y funciona con otro nombre) a los tres meses me transfirieron al hotel miranda de coro en falcón , a los seis meses me convertí en el supervisor de todos los chefs  de conahotu ,mi edad contaba los 26 años mi vida fue de éxitos en éxitos y comencé a tener restaurantes propios a veces con socios , otras veces solo. Me divorcie de la merideña y en cuatro años me uní en matrimonio con una zuliana, mi actual esposa.</p>\r\n<p class="text-justify"> Me invito a un magazín mañanero en (venezolana de televisión) mañanero Cecilia Martínez me entrevisto, prepare una breve receta y ella quedo encantada. Conocí a Mari Pili Hernández, periodista, narradora de noticias en venezolana de televisión y conductora del magazín Súper Mañana y todos los miércoles salía al aire un micro de 10 minutos de una receta breve de Dino que se grababa en restaurante “Torre Vieja” en las mercedes, un día al terminar la grabación el señor Eladio Lares provoco los aplausos del público que llenaba el restaurante y me invito a elaborarle un prospecto de un programa de una hora en RCTV. Lo elabore pero nunca coincidimos en las citas que nos dábamos.</p>\r\n<p class="text-justify">Alguien me informo que un canal TELEVEN  estaba saliendo al aire en periodo de prueba.  Lleve el mismo prospecto a televen y una semana después estaba saliendo al aire en un magazín llamado música y chistes. Al poco tiempo se acabaron los chistes y la música u se quedó Dino solo con su programa  DESDE MI COCINA con duración de un hora, en el cual me desempeñe como cocinero cantante o cantante que cocina, tres Sketch complementaban el programa.</p>\r\n\r\n<ol>\r\n<li><a href="#">El poder curativo de los vegetales.</a></li>\r\n<li><a href="#">Curiosidades de la cocina.</a></li>\r\n<li><a href="#">Reflexiones para vivir mejor.</a></li>\r\n</ol>\r\n<p class="text-justify">Todo el programa se fue haciendo importante cada vez más, la prensa escrita se ocupó mucho de mi hasta el punto que llegaron a llamarme el monstruo de la mañana, yo siempre me preocupe para enseñar a cocinar al Ama De Casa y no a los Chefs hice recetas locas como “sushi a la Italiana” “Arepa Cuadrada” “Carne mechada con concha de plátano” “Sopa de maría Juana con tostones de plátano Etc.”.</p>\r\n<p class="text-justify">De éxito en éxito llego el año 2002 <b>DIOS BENDIGA SIEMPRE A TELEVEN</b> vino el nefasto paro (En el canal y que cívico) Y cuando llegue en febrero del 2002 a televen me encontré que televen había suspendido toda la programación de la mañana. Era mes de junio del 2002 cuando me llamaron de  “LA TELE”. Allí renuncie después de tres años para dedicarme a otras actividades siempre relacionadas con la cocina.</p>\r\n</div>', '', 'html5');
