(10, 'node', ' biografía mi historia llegué a venezuela un día de mayo de 1955 entré por el puerto de la guáira el propósito  trabajar durante uno o dos años para guardar suficiente dinero para regresar a mi italia querida y terminar mis estudios de medicina  no sucedió así las dificultades como el idioma la alimentación la adaptación el ambiente la soledad el miedo al que será cambiaron todos mis planes fui lavaplatos mesero conocí a varios cocineros en varios restaurantes y me di cuenta que yo cocinaría mejor que ellos pero callaba para no ganarme enemigos pero un día sucedió que el chef del restaurante donde yo trabajaba como mesonero se cayó y se fracturó un brazo los dueños del restaurante se desesperaron y yo me atreví a decirles si quieren o me lo permiten yo puedo hacerme cargo les explique que desde muy pequeño viví entre ollas y sartenes en la cocina de la hostería de mi tío allá en italia aceptaron de mala gana ya que no tenían otra alternativa ese día comenzó mi carrera como chef en venezuela era mayo de 1957 ya tenía dos años en venezuela esa noche 15051957 a los clientes que me reclamaban como mesonero en la sala uno de los dueños que me sustituyo orgullosamente gritaba dino es nuestro chef a partir de hoy y muchos clientes entraron a la cocina a felicitarme a dejarme jugosas propinas las salsas las carnes los pescados los convertí en delicias recuerdo que al final de ese día conté los primeros 880 bolívares repartí la mitad con el personal de la cocina y el cariño los abrazos y los besos de personal femenino me abrumaron y comencé a sentirme menos solo la noticia se difundió en la zona en el hotel rex de ciudad ojeda hay un cocinerito que cocina demasiado sabroso y dos semanas después la gente hacia cola para conseguir una mesa cuando tony el chef llego de nuevo con su brazo más o menos sano los dueños le dijeron nos quedamos con dino lo lamenté mucho por el comenzaron las entrevistas en la radio en la prensa escrita las ofertas de trabajo con mejor remuneración pero yo le fue fiel al hotel rex dicté varios cursos de cocina en un salón que me facilitaron los dueños el hotel pasaron varios años y luego me fui para mérida porque por mi espíritu aventurero tal vez por el clima tal vez por una merideña tal vez tal vez pero me fui para mérida conocí a leonardo páez ecuatoriano demasiado culto e inteligente y director de radio universidad y por primera vez tuve un micrófono delante de mí y conduje un programa el  ama de casa en la cocina   bajo la batuta del maestro dino era el año 1960 al mismo tiempo trabajaba en el hotel la sierra que ya no existe conocí al dr pedro rincón gutiérrez rector de la universidad de los andes quien me animo a revalidar mis estudios de medicina no fue posible un día llego al hotel la sierra una comisión de conahotu corporación nacional de hoteles y turismo me conquistaron y me contrataron como chef del hotel trujillo todavía existe y funciona con otro nombre a los tres meses me transfirieron al hotel miranda de coro en falcón a los seis meses me convertí en el supervisor de todos los chefs de conahotu mi edad contaba los 26 años mi vida fue de éxitos en éxitos y comencé a tener restaurantes propios a veces con socios otras veces solo me divorcie de la merideña y en cuatro años me uní en matrimonio con una zuliana mi actual esposa me invito a un magazín mañanero en venezolana de televisión mañanero cecilia martínez me entrevisto prepare una breve receta y ella quedo encantada conocí a mari pili hernández periodista narradora de noticias en venezolana de televisión y conductora del magazín súper mañana y todos los miércoles salía al aire un micro de 10 minutos de una receta breve de dino que se grababa en restaurante torre vieja en las mercedes un día al terminar la grabación el señor eladio lares provoco los aplausos del público que llenaba el restaurante y me invito a elaborarle un prospecto de un programa de una hora en rctv lo elabore pero nunca coincidimos en las citas que nos dábamos alguien me informo que un canal televen estaba saliendo al aire en periodo de prueba lleve el mismo prospecto a televen y una semana después estaba saliendo al aire en un magazín llamado música y chistes al poco tiempo se acabaron los chistes y la música u se quedó dino solo con su programa desde mi cocina con duración de un hora en el cual me desempeñe como cocinero cantante o cantante que cocina tres sketch complementaban el programa el poder curativo de los vegetales curiosidades de la cocina reflexiones para vivir mejor todo el programa se fue haciendo importante cada vez más la prensa escrita se ocupó mucho de mi hasta el punto que llegaron a llamarme el monstruo de la mañana yo siempre me preocupe para enseñar a cocinar al ama de casa y no a los chefs hice recetas locas como sushi a la italiana arepa cuadrada carne mechada con concha de plátano sopa de maría juana con tostones de plátano etc de éxito en éxito llego el año 2002 dios bendiga siempre a televen vino el nefasto paro en el canal y que cívico y cuando llegue en febrero del 2002 a televen me encontré que televen había suspendido toda la programación de la mañana era mes de junio del 2002 cuando me llamaron de la tele allí renuncie después de tres años para dedicarme a otras actividades siempre relacionadas con la cocina  ', 0);
